/**
 * Borders
 */
.release-bar {
  order: -1;
}
.release-bar-inner {
  height: 25px;
  display: block;
  padding-left: 10px;
  padding-top: 2px;
  color: #87939a;
  background-color: #00ac6f;
  border-bottom: 1px solid #00794e;
}
.release-bar-inner:hover {
  background-color: #00794e;
  border-bottom: 1px solid #00603e;
  text-decoration: none;
  color: white;
}
.release-bar-inner i {
  margin-right: 8px;
}
